  const dispatch = useDispatch();
  const {influencerList,loading} = useSelector((state)=>state.influencer);
  useEffect(()=> {
    dispatch(getInfluencer())
  },[dispatch]);
  
  return (
    <div>
      {influencerList.map(el=>(
        <>
          <h4> {el.firstName}</h4>

        </>
      ))}
    </div>
  )
};

